import React, { useRef } from 'react'
import "./video.css"



function Video() {

    const videoRef = useRef(null)

        function handdleStart() {
            videoRef.current.play()
        }

    return (
        <div className='video'>

            <video 
                className='video__player'
                ref={videoRef}
                onClick={handdleStart}
                loop
                src="https://youtu.be/07d2dXHYb94?t=94"
            >

            </video>

        </div>
    )
}

export default Video
